<template>
  <div>
    <div class="container" v-loading="loading">
      <!-- 扫描仪扫描的图片 -->
      <div v-for="(item,index) in base64ImageData" :key="index">
        <div class="el-upload--picture-card" v-bind:title="message">
          <img :src="item" width="100%" style="height:146px" @click="handleRemove(index)" />
        </div>
      </div>
      <!-- 手动上传的图片 -->
      <div style="padding-left:5px">
        <el-upload
          action="/upload"
          multiple
          ref="upload"
          accept="image/*"
          list-type="picture-card"
          :auto-upload="false"
          :data="formData"
          :on-remove="handleRemove"
          :on-change="handleChange"
        >
          <i class="el-icon-plus"></i>
        </el-upload>
      </div>
    </div>
  </div>
</template>

<script>
export default {
  data() {
    return {
      loading: false,
      message: "这是扫描仪上传的图片,点击可以删除",
      formData: {
        filePath: ""
      },
      fileList: [],
      base64ImageData: [
        "data:image/jpg;base64,",
        "data:image/jpg;base64,",
        "data:image/jpg;base64,"
      ],
      iconList: [], //存储文件信息
      fileList: [], //存储文件
      dialogVisible: false,
      isSuccess: "isSuccess"
    };
  },
  methods: {
    submit() {
      if (this.formData.filePath === "") {
        this.$message.error("请选择上传目录");
        return;
      }

      var params = new FormData();
      this.base64ImageData.forEach((item, index) => {
        params.append("file", this.base64ToFile(item, this.uuid() + ".jpg"));
      });

      this.fileList.forEach(item => {
        params.append("file", item.raw);
      });

      params.append("filePath", this.formData.filePath);

      this.loading = true;
      this.postRequest("/upload", params).then(response => {
        this.loading = false;
      });
    },
    handleChange(file, fileList) {
      this.fileList.push(file);
    },

    handleRemove(index) {
      this.base64ImageData.splice(index, 1);
    },

    // 生成uuid
    uuid() {
      var s = [];
      var hexDigits = "0123456789abcdef";
      for (var i = 0; i < 36; i++) {
        s[i] = hexDigits.substr(Math.floor(Math.random() * 0x10), 1);
      }
      s[14] = "4"; // bits 12-15 of the time_hi_and_version field to 0010
      s[19] = hexDigits.substr((s[19] & 0x3) | 0x8, 1); // bits 6-7 of the clock_seq_hi_and_reserved to 01
      s[8] = s[13] = s[18] = s[23] = ""; // "" 引号里面可以加任意字符，代表拼接的意思，如果不加就是 纯32位支付

      var uuid = s.join("");
      return uuid;
    },

    // 解码base64
    base64ToFile(urlData, fileName) {
      const arr = urlData.split(",");
      const mime = arr[0].match(/:(.*?);/)[1];
      const bytes = atob(arr[1]); // 解码base64
      let n = bytes.length;
      const ia = new Uint8Array(n);
      while (n--) {
        ia[n] = bytes.charCodeAt(n);
      }
      return new File([ia], fileName, { type: mime });
    }
  }
  
};
</script>

